According to the agreement, Confidential Information means "all confidential information (however recorded, preserved or disclosed)" and includes but is not limited to:

- The fact that discussions and negotiations are taking place concerning the Purpose and the status of those discussions and negotiations;
- The existence and terms of this Agreement;
- Any information that would be regarded as confidential by a reasonable business person relating to: 
  - The business, affairs, customers, clients, suppliers, plans, intentions, or market opportunities of the Disclosing Party; 
  - The operations, processes, product information, know-how, designs, trade secrets or software of the Disclosing Party;
- Any information or analysis derived from Confidential Information;

This implies that Confidential Information is not limited to technical information.
